import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import './Experience.css';

interface ExperienceItem {
  id: string;
  title: string;
  company: string;
  location: string;
  duration: string;
  description: string[];
  technologies: string[];
}

const Experience: React.FC = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  // Sample experience data - in real implementation, this would come from PDF parsing
  const experiences: ExperienceItem[] = [
    {
      id: '1',
      title: 'Senior Frontend Developer',
      company: 'Tech Solutions Inc.',
      location: 'San Francisco, CA',
      duration: '2020 - Present',
      description: [
        'Led development of responsive web applications using React, TypeScript, and modern CSS frameworks',
        'Implemented comprehensive accessibility features achieving WCAG 2.1 AA compliance across all projects',
        'Mentored junior developers and established frontend coding standards and best practices',
        'Collaborated with UX/UI designers to create pixel-perfect, user-centric interfaces',
        'Optimized application performance resulting in 40% improvement in Core Web Vitals scores'
      ],
      technologies: ['React', 'TypeScript', 'Next.js', 'Tailwind CSS', 'GraphQL', 'Jest']
    },
    {
      id: '2',
      title: 'Frontend Developer',
      company: 'Digital Agency Pro',
      location: 'New York, NY',
      duration: '2017 - 2020',
      description: [
        'Developed and maintained multiple client websites using Vue.js and Angular frameworks',
        'Implemented responsive design patterns and mobile-first development approaches',
        'Integrated RESTful APIs and managed state using Vuex and NgRx',
        'Collaborated with cross-functional teams to deliver projects on time and within budget',
        'Conducted code reviews and participated in agile development processes'
      ],
      technologies: ['Vue.js', 'Angular', 'SCSS', 'Webpack', 'Node.js', 'MongoDB']
    },
    {
      id: '3',
      title: 'Junior Frontend Developer',
      company: 'StartupXYZ',
      location: 'Austin, TX',
      duration: '2015 - 2017',
      description: [
        'Built interactive web interfaces using HTML5, CSS3, and vanilla JavaScript',
        'Converted PSD designs to responsive, cross-browser compatible web pages',
        'Implemented jQuery plugins and custom animations to enhance user experience',
        'Worked closely with backend developers to integrate frontend with APIs',
        'Participated in daily standups and sprint planning meetings'
      ],
      technologies: ['HTML5', 'CSS3', 'JavaScript', 'jQuery', 'Bootstrap', 'Gulp']
    },
    {
      id: '4',
      title: 'Web Developer Intern',
      company: 'Creative Web Studio',
      location: 'Remote',
      duration: '2014 - 2015',
      description: [
        'Assisted in developing static websites and landing pages for small businesses',
        'Learned fundamental web technologies and development workflows',
        'Created responsive layouts using CSS frameworks and media queries',
        'Gained experience with version control systems and collaborative development'
      ],
      technologies: ['HTML', 'CSS', 'JavaScript', 'WordPress', 'PHP', 'Git']
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, x: -20 },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 0.6,
      },
    },
  };

  return (
    <section id="experience" className="experience" ref={ref}>
      <div className="container">
        <motion.div
          variants={containerVariants}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          className="experience-content"
        >
          <motion.div variants={itemVariants} className="experience-header">
            <h2>Professional Experience</h2>
            <div className="section-divider"></div>
            <p className="experience-subtitle">
              12+ years of building exceptional web experiences
            </p>
          </motion.div>

          <div className="timeline">
            {experiences.map((exp, index) => (
              <motion.div
                key={exp.id}
                variants={itemVariants}
                className="timeline-item"
              >
                <div className="timeline-marker">
                  <div className="timeline-dot"></div>
                  {index < experiences.length - 1 && <div className="timeline-line"></div>}
                </div>

                <div className="timeline-content">
                  <div className="experience-card">
                    <div className="card-header">
                      <div className="job-info">
                        <h3 className="job-title">{exp.title}</h3>
                        <div className="company-info">
                          <span className="company">{exp.company}</span>
                          <span className="location">{exp.location}</span>
                        </div>
                      </div>
                      <div className="duration">{exp.duration}</div>
                    </div>

                    <div className="card-body">
                      <ul className="responsibilities" role="list">
                        {exp.description.map((item, idx) => (
                          <li key={idx} role="listitem">{item}</li>
                        ))}
                      </ul>

                      <div className="technologies">
                        <h4>Technologies Used:</h4>
                        <div className="tech-tags" role="list" aria-label="Technologies used">
                          {exp.technologies.map((tech) => (
                            <span key={tech} className="tech-tag" role="listitem">
                              {tech}
                            </span>
                          ))}
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              </motion.div>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Experience;
